 async (debug?: boolean) => {
  forAllFolders({
    type: "operations",
    basePath: getPathsWithOperations(),
    callback: async (folderPath, index) => {
      const operationName = getLastFolder(folderPath);
      log(`#${index}: README for ${operationName}`, { type: "success" });
      await operationToMarkdown({ operationName, mergeDocsInline: true });
      return;
    },
  });
}
